import Product from "./components/Product";
import MainHeader from "./components/MainHeader";
import Login from "./Login";


export default class App extends React.Component {
  render() {
    return (
      <div>
        {/* <p>Hello, Hello!</p> */}
        <header>
          <MainHeader />
        </header>

        <main>
          <Route path="/login">
          <Login />
          </Route>
          <Route path="/products">
            <Product />
          </Route>
        </main>


      </div>
    );
  }
}
